import React from "react";
import { Button } from "../components/ui/button";
import MoreVertIcon from '@mui/icons-material/MoreVert';import {
  DropdownMenu,
  DropdownMenuContent,
  DropdownMenuItem,
  DropdownMenuLabel,
  DropdownMenuSeparator,
  DropdownMenuTrigger,
} from "../components/ui/dropdown-menu";

const HeaderNote = () => {
  return (
    <div class="flex justify-between items-center backdrop-blur-0 bg-gray-200 rounded-t-sm rounded-b-xl mb-5">
      <div>
        <h1 class="text-4xl font-bold p-4">Notes</h1>
      </div>
      <div class="pr-4">
        <DropdownMenu>
          <DropdownMenuTrigger>
            <Button variant="outline">
              <AddIcon />
            </Button>
          </DropdownMenuTrigger>
          <DropdownMenuContent>
            <DropdownMenuLabel>My Account</DropdownMenuLabel>
            <DropdownMenuSeparator />
            <DropdownMenuItem>Profile</DropdownMenuItem>
            <DropdownMenuItem>Billing</DropdownMenuItem>
            <DropdownMenuItem>Team</DropdownMenuItem>
            <DropdownMenuItem>Subscription</DropdownMenuItem>
          </DropdownMenuContent>
        </DropdownMenu>
      </div>
    </div>
  );
};

export default HeaderNote;
